import React, { Component } from 'react'

class UpdateBreederProfileForm extends Component {

    state = {

    }

    render() {
        let breeder = this.props.currentLogin
        return (
            <div>
                <h2>{breeder.name}</h2>
                <p>{breeder.address}</p>
                <p>{breeder.phone}</p>
                <p>{breeder.email}</p>
                <p>{this.props.breeder.password}</p>
            </div>
        )
    }
}

export default UpdateBreederProfileForm
